import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
    	<div class="container-fluid call-phone">
    		<div className="row a">
    			<div className="col-5">
    				Call Time: 00:00:00
    			</div>
    	</div>
    	</div>
    );
  }
}

export default App;
